import "./style/App.css";
import Login_form from "./component/login_form";
import Create_address from "./component/create_address";
import Find_id from "./component/find_id";
import Find_pass from "./component/find_pass";
import { BrowserRouter, Route, Routes } from "react-router-dom";
import Main from "./component/main";
import Info_modify from "./component/info_modify";
import Schedule from "./component/schedule";
import Products from "./component/products";
function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<Login_form></Login_form>}></Route>

          <Route
            path="/create"
            element={<Create_address></Create_address>}
          ></Route>
          <Route path="/find_id" element={<Find_id></Find_id>}></Route>
          <Route path="/find_pass" element={<Find_pass></Find_pass>}></Route>
          <Route path="/main" element={<Main></Main>}></Route>
          <Route
            path="/main/Info_modify"
            element={<Info_modify></Info_modify>}
          />
          <Route path="/main/Schedule" element={<Schedule></Schedule>} />
          <Route path="/main/Products" element={<Products></Products>} />
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
